import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Your Name</h1>
        <p>Your Title</p>
        <p>Contact: your.email@example.com</p>
      </header>
      <section>
        <h2>Experience</h2>
        <p>Details about your work experience.</p>
      </section>
      <section>
        <h2>Education</h2>
        <p>Details about your education.</p>
      </section>
      <section>
        <h2>Skills</h2>
        <p>Details about your skills.</p>
      </section>
    </div>
  );
}

export default App;
